export function Cart(prop) {
    return <div>
    <h3>Cart </h3>
    <table className="table table-dark table-bordered">
      <thead>
        <tr>
          <th>Title</th>
          <th>Category</th>
          <th>Price</th>
          <th>Count</th>
          <th>Subtotal</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {
          prop.date.map(Element => {
            return <tr key={Element.id}>
              <td>{Element.title}</td>
              <td>{Element.category}</td>
              <td>{Element.price}</td>
              <td>{Element.count}</td>
              <td>{Element.count * Element.price}   </td>
